Join us in REVELATION 5 as we read about the scroll with seven seals. Here at the scene of the heavenly throne, John weeps because no man is worthy to open the seven-sealed scroll. Today we may identify with John's weeping as we read the headlines from around the world and the hurt therein. But John is told not to weep! For Jesus is worthy, to open the seven-sealed scroll. Study with us the Savior Jesus, and His perfect timing.
